var record = function(host, pageRank, framework, usedSelectors, state){
  // exists .csv ? writeline : makeCSV callback(writeline)
  // makeCSV: frameworkRepository[framework].csv
  // writeLine: pageRank, host, used, of, allSelectors
  // allSelectors = frameworkRepository[framework].map(checkUsed(sel){usedSelectors.indexOf(sel)>=0 ? return 1 : return 0;});
  // used = allSelectors.reduce(function(z,y){return z+y});
  // of = allSelectors.length;
  // TODO: return a value
  if (frameworkRepository[framework]){
    var file = 'data/frameworks/'+framework+'.csv';
    fs.exists(file, function(exists){
      if(exists) writeLine(host, pageRank, file, framework, usedSelectors, state);
      else makeCSV(host, pageRank, file, framework, usedSelectors, state, writeLine);
    });
  }
  else return state.callback(framework, 0, state.queue), false;
};

function writeLine(host, pageRank, path, framework, usedSelectors, state, stream){
  var file = stream || fs.createWriteStream(path, {'flags': 'a'}),
    allSelectors = frameworkRepository[framework].length,
    selectors = frameworkRepository[framework].map(function(s){
      return usedSelectors.indexOf(s)<0 ? 0 : 1;
    }),
    usedCount = selectors.reduce(function(a,b){return a+b}),
    percentage = (usedCount/allSelectors)*100,
    matched = [pageRank, host, usedCount, allSelectors, percentage.toFixed(2)].concat(selectors);
  file.write(matched.join(",")+"\n", 'utf8', function(){
    file.end();
    state.callback(framework, matched[4], state.queue);
  });
}

function makeCSV(host, pageRank, path, framework, usedSelectors, deferredCallback, callback){
  var file = fs.createWriteStream(path, {'flags': 'a'}),
      header = ["Page Rank", "Website", "Used", "Total", "Proportional Use"].concat(frameworkRepository[framework]);
  file.write(header.join(",")+"\n", 'utf8', function(){
    callback(host, pageRank, path, framework, usedSelectors,deferredCallback, file);
  });
}


exports.record = function(host, pageRank, framework, usedSelectors, state){
  return record (host, pageRank, framework, usedSelectors, state);
};

